import React, {Component} from 'react';

class Cloud extends Component {
    constructor(){
        super();
        this.state ={
            day: '',
            month: '',
            years: ''
        }
    }

    rnederCost(){
        return (
            <div>
                <p>{this.state.day}</p>
            </div>
        )
    }

    render(){
        return(
            <div>
                <h1>Cloud</h1>

            </div>
        )
    }
}
export default Cloud;
